import './App.css';
import React, { useState, } from 'react';
import Navbar from "./Components/Navbar";
import Section from "./Components/Section";
import dummyText from "./DummyText";
import About from "./Components/About"
import Resume from "./Components/Resume"

function App() {
  const [focus, setFocus] = useState({
    about: true,
    resume: false,
    portfolio: false
  })
  return (
    <div className="App">
      <Navbar setFocus={(e) => console.log(e)} />
      <Section
        content = {About(focus.about)}
        dark={false}
        id="section1"
      />
      <Section
        content = {Resume(focus.resume)}
        dark={true}
        id="section2"
      />
      <Section
        content = {dummyText}
        dark={false}
        id="section3"
      />
    </div>
  );
}

export default App;
